class AbstractModelPhotographer{constructor(t){if(this.constructor===AbstractModelPhotographer)throw new TypeError('Abstract class "AbstractPhotographer" cannot be instantiated directly');this._name=t.name,this._picture="assets/photographers/"+t.portrait}getUserCardDOM(){var t=document.createElement("article"),e=document.createElement("img"),r=(e.setAttribute("src",this._picture),document.createElement("h2"));return r.textContent=this._name,t.appendChild(e),t.appendChild(r),t}}class AbstractTemplatePhotographer{constructor(t){if(this.constructor===AbstractModelPhotographer)throw new TypeError('Abstract class "AbstractPhotographer" cannot be instantiated directly');this._name=t._name,this._picture=t._picture}getRender(){var t=document.createElement("article"),e=document.createElement("img"),r=(e.setAttribute("src",this._picture),document.createElement("h2"));return r.textContent=this._name,t.appendChild(e),t.appendChild(r),t}}function photographerFactory(t,e){if(e){if(Number.isInteger(e))return new PhotographerModelPage(t);throw"Unknown id format"}return new PhotographerModelCard(t)}async function getPhotographers(){return fetch("./data/photographers.json").then(t=>t.json())}